/*Table structure for table `j_video_area` */

DROP TABLE IF EXISTS `j_video_area`;

CREATE TABLE `j_video_area` (
  `area_id` varchar(64) NOT NULL COMMENT '地区id:美国,国产等',
  `name` varchar(10) NOT NULL COMMENT '地区名称',
  `sort` int(4) DEFAULT NULL COMMENT '排序',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
