CREATE TABLE `j_video_move` (
  `move_id` varchar(64) NOT NULL COMMENT '视频上级id',
  `move_name` varchar(64) NOT NULL COMMENT '视频父级名称',
  `photo` varchar(500) DEFAULT NULL COMMENT '视频父级显示的图片',
  `play_url` varchar(500) DEFAULT NULL COMMENT '播放链接',
  `type_id` varchar(64) DEFAULT NULL COMMENT '分类id:电视剧,电影等',
  `area_id` varchar(64) DEFAULT NULL COMMENT '地区id:美国,国产等',
  `style_id` varchar(64) DEFAULT NULL COMMENT '风格id:科技,搞笑',
  `time_id` varchar(64) DEFAULT NULL COMMENT '时间年代id:2018,2017等',
