insert  into `j_video_move`(`move_id`,`move_name`,`photo`,`play_url`,`type_id`,`area_id`,`style_id`,`time_id`,`introduce`,`sort`,`create_date`,`update_date`,`create_user`,`update_user`,`enable`) values ('0c4c909f5cea478ebe9a30978c5c66b4','头号玩家TS','http://img.71xun.com/FopWytiPvrGKMdBvzUeXHng_er_u','http://vd3.bdstatic.com/mda-ie9w0fnphzc3z7vx/sc/mda-ie9w0fnphzc3z7vx.mp4','1','12','31','51','在2045年，现实世界衰退破败，人们沉迷于VR(虚拟现实)游戏“绿洲(OASIS)”的虚幻世界里寻求慰藉。马克·里朗斯饰演的“绿洲”的创始人临终前宣布，将亿万身家全部留给寻获他隐藏的彩蛋的游戏玩家，史上最大规模的寻宝冒险就此展开，由泰伊·谢里丹饰演的男主角韦德·沃兹(Wade Watts/Parzival)和数十亿竞争者踏上奇妙而又危机重重的旅途。',31,NULL,'2018-08-01 00:00:00',NULL,NULL,'0'),('0d3e478e9fa44715a41bf144a1741637','红海行动','http://img.71xun.com/FpHAJ_lxzaetrQH61Cc_l17qzSYe','http://youku.cdn1-letv.com/20180430/10185_f871cde0/index.m3u8','1','11','31','51','索马里海域外，中国商船遭遇劫持，船员全数沦为阶下囚。蛟龙突击队沉着应对，潜入商船进行突袭，成功解救全部人质。返航途中，非洲北部伊维亚共和国发生政变，恐怖组织连同叛军攻入首都， 当地华侨面临危险，海军战舰接到上级命令改变航向，前往执行撤侨任务。蛟龙突击队八人，整装待发。时间紧迫，在“撤侨遇袭可反击，相反则必须避免交火，以免引起外交冲突”的大原则下，海军战舰及蛟龙突击队深入伊维亚...',26,NULL,'2018-04-30 00:00:00',NULL,NULL,'0'),('0d9730356e994daca5bee091b818b96a','狄仁杰之四大天王','http://img.71xun.com/Fv3n-wrjvplEgpeOzXCzIyjMlEIq','https://s.bwzybf.com/20180730/PWoEd7ZJ/index.m3u8','1','11','31','51','狄仁杰（赵又廷 饰）大破神都龙王案，获御赐亢龙锏，并掌管大理寺，使他成为武则天（刘嘉玲 饰）走向权力之路最大的威胁。武则天为了消灭眼中钉，命令尉迟真金（冯绍峰 饰）集结实力强劲的「异人组」，妄图夺取亢龙锏。在医官沙陀忠（林更新 饰）的协助下，狄仁杰既要守护亢龙锏，又要破获神秘奇案，还要面对武则天的步步紧逼，大唐江山陷入了空前的危机之中……',50,NULL,'2018-08-16 00:00:00',NULL,NULL,'0'),('10f5ed16458b4757b112a77109121d31','黑豹HD','http://img.71xun.com/FluuAqVy0IpPUtgh0WweAz37YOq4','https://youku.cdn-iqiyi.com/20180501/10726_d027d600/index.m3u8','1','12','31','51','在漫威影业的影片《黑豹》中，特查拉在其父亲——前瓦坎达国王去世之后，回到了这个科技先进但与世隔绝的非洲国家，继任成为新一任“黑豹”及国王。当旧敌重现时，作为“黑豹”及国王的特查拉身陷两难境地，眼看着瓦坎达及全世界陷于危难之中。面对背叛与危险，这位年轻的国王必须联合同盟，释放“黑豹”全部力量，奋力捍卫他的人民和国土。',30,NULL,'2018-06-08 00:00:00',NULL,NULL,'0'),('16b995778e004a999d1ce9310b0974d8','雷神一','http://img.71xun.com/FvmgcoUXj5MTyhNiUpo-0FVdCy-M','http://cn2.okokyun.com/20180123/xSJ8UQOu/index.m3u8','1','12','34','58','勇敢善战雷神托尔（克里斯•海姆斯沃斯 Chris Hemsworth 饰），作为永恒境界阿斯加德的王位继承人，受人敬仰。然而由于一次鲁莽的行动，险些挑起一场古老的战争，因此被父亲天神奥丁（安东尼•霍普金斯 Anthony Hopkins 饰）流放到人间。托尔在人间认识了 美丽的女科学家珍•福斯特（娜塔莉•波特曼 Natalie Portman 饰）和她的工作伙伴，在他们的帮助下，托尔找到了和自己一起被贬的雷神之锤，但此时的雷神之锤并不属于他。',9,'2018-05-25 00:00:00','2018-05-25 00:00:00',NULL,NULL,'0'),('38954f5f71ea46799534736c6c54d138','死侍2','http://img.71xun.com/FrQvbBAsyqaXnH9kI4Aq3jmsN_HF','https://s.bwzybf.com/20180726/Km0nIkiW/index.m3u8','1','12','31','51','福斯在CinemaCon宣布《死侍2》已在开发中，主演瑞安·雷诺兹、导演蒂姆·米勒、编剧略特·里斯&保罗·韦尼克将悉数回归，与死侍颇有渊源的锁链（Cable）一角将出现在续集中。',30,NULL,'2018-08-26 00:00:00',NULL,NULL,'0'),('3e0c6f9cd8f149729dd4876408f78276','古墓丽影：源起之战','http://img.71xun.com/FpecUr1OVB_IJ3Q0LkbSlEww0noO','http://vip.okzybo.com/20180319/ONo82Y23/index.m3u8','1','12','31','51','劳拉·克劳馥年少时，她的冒险家父亲突然神秘消失。她拒绝接受父亲已经去世的事实，并暗下决心要解开父亲神秘死亡的谜团。放下眼前的一切，劳拉前往父亲最后出现的地方探寻——一座传说中的古墓，位于日本附近某个神秘岛上。要踏上这场未知的旅程，她必须以敏锐的头脑、坚定的信仰和顽强的精神武装自己，并迫使自己超越极限。如果她能在这场危机四伏的冒险中存活下来，她才可能成长为名副其实的——“古墓丽影”。',35,'2018-05-29 00:00:00','2018-05-29 00:00:00',NULL,NULL,'0'),('458bd8fd0552406a9728f3d100095637','熊出没·变形记','http://img.71xun.com/Fn-HFMZdbIZaeUA9tVgAxIDU6plZ','https://youku.cdn-tudou.com/20180601/6209_32ed50a5/index.m3u8','1','11','32','51','光头强爸爸突然到访狗熊岭，向来严厉古板的强爸却对光头强嘘寒问暖，而朝夕相处却未能缓和关系，反而导致了父子矛盾的爆发……在一次激烈的争吵中，光头强和两熊被“缩小机”意外缩小，毫不知情的强爸伤心离开，并无意间带走了“缩小机”。于是，光头强和两熊踏上了追赶强爸和机器的“微观世界”冒险之旅。与此同时，一名陌生国外女记者突然出现，并频频出没于大马哈鱼生活的河域附近，举止神秘，牵出了一系列神秘事件……',37,NULL,'2018-06-08 00:00:00',NULL,NULL,'0'),('56031a3063b64c2fb935b5893a8600a7','金蝉脱壳2','http://img.71xun.com/FvzYNt-DQi-37ipBM3ni1o6ZtFJi','http://cdn.letv-cdn.com/20180618/3wYaVo6p/index.m3u8','1','12','31','51','2013年，《金蝉脱壳》中史泰龙和施瓦辛格联手越狱还原“真人魂斗罗”组合。时隔四年，续作《金蝉脱壳2》回归，灵魂人物超级硬汉史泰龙重出江湖，再次出演运筹帷幄的越狱专家，携手黄晓明和戴夫·巴蒂斯塔等，再掀越狱风云。',47,'2018-07-15 00:00:00','2018-07-15 00:00:00',NULL,NULL,'0'),('571209c8ca8d4b83b7697224538da9e5','动物世界','http://img.71xun.com/FhOlPwXXpta-1aoCc5045PukFGVl','https://apis.tianxianle.com/mp4/mp4.php?id=http://vd3.bdstatic.com/mda-ig9ri60595dbuv74/sc/mda-ig9ri60595dbuv74.mp4','1','11','31','51','男主角郑开司因被朋友欺骗而背负上数百万的债务，面对重病的母亲和痴心等待的青梅竹马，他决心登上“命运号”游轮，改变自己一事无成的人生。只要能在渡轮上的游戏中获胜，他就将有机会将债务一笔勾销，并给家人带来更好的生活。这场游戏看似简单，参与者只需以标着“石头，剪刀，布”的扑克为道具，赢取对手身上的星星标志。但游轮上的亡命徒们毫无底线的欺诈争夺，却让人性的自私与残酷暴露无遗，局中局、计中计，让游戏场最终沦为“动物世界”斗兽场。面对绝境的郑开司，能否坚守自我底线保持善良本性？能否凭借自己的智慧和坚韧摆脱困境？这是一场自我救赎的残酷游戏，多重考验也将接踵而至。',46,NULL,'2018-07-11 00:00:00',NULL,NULL,'0'),('6e1aabf8ef104acb8635b626491cb2f3','西虹市首富','http://img.71xun.com/FtrL6u9uAwx2w3eNvLWtx10gCRnd','https://baidu.com-v-baidu.com/20180730/5069_784f5519/index.m3u8','1','11','32','51','《西虹市首富》的故事发生在《夏洛特烦恼》中的“特烦恼”之城“西虹市”。混迹于丙级业余足球队的守门员王多鱼（沈腾饰演），因比赛失利被开除离队。正处于人生最低谷的他接受了神秘台湾财团“一个月花光十亿资金”的挑战。本以为快乐生活就此开始，王多鱼却第一次感到“花钱特烦恼”！想要人生反转走上巅峰，真的没有那么简单。',49,NULL,'2018-09-02 00:00:00',NULL,NULL,'0'),('6f14c62b470c42ac98712eac078d02fa','侏罗纪世界2','http://img.71xun.com/FldrEmEoLyJV5IbRdAqrFLKLabgI','http://vd3.bdstatic.com/mda-ifp1nhxwph551ux3/sc/mda-ifp1nhxwph551ux3.mp4','1','12','34','51','侏罗纪世界主题公园及豪华度假村被失控的恐龙们摧毁已有四年。如今，纳布拉尔岛已经被人类遗弃，岛上幸存的恐龙们在丛林中自给自足。当岛上的休眠火山开始活跃以后，欧文（克里斯·帕拉特饰）与克莱尔（布莱丝·达拉斯·霍华德 饰）发起了一场运动，想要保护岛上幸存的恐龙们免于灭绝。欧文一心想要找到自己依然失踪在野外的迅猛龙首领布鲁，克莱尔如今也尊重起这些生物，以保护它们为己任。两人在熔岩开始喷发时来到了危险的小岛，他们的冒险也揭开了一个可能让地球回到史前时代般混乱秩序的阴谋。',45,NULL,'2018-07-13 00:00:00',NULL,NULL,'0'),('7e2181a9e8174f7e8eecd442d28468b0','搭车有戏','http://img.71xun.com/FlRft7TJ5h5Z0kau3ZYhu1ae1KMO','http://s.bwzybf.com/20180427/haqKA7eD/index.m3u8','1','11','32','51','对画画充满一腔热爱的隋汴迫于生活的压力，不得已成为了一名专职网约车司机，最初完全不满于当个司机的隋汴却打开了人生的新篇章，开始和不同职业不同身份的乘客上演悲喜交加却十分现实的故事。落魄的电影导演刘小君，有着明确的创业计划和未来蓝图却惨遭现实打击的午夜派送员托尼贾，被父亲寄予厚望却希望成为一名演员的电子竞技职业美女选手霍兰……真性情的隋汴不仅努力继续着自己的人生，也会意外地参与到别人的人生中去，并从别人的故事中得到更多感悟。一个人坐上车，一个人又下了车。一个故事来了，一个故事又走了。',7,NULL,'2018-05-15 00:00:00',NULL,NULL,'0'),('9ff60dfc8b584c679f8970cbea64744c','一出好戏','http://img.71xun.com/FpAJuTNHUbfhpXslBOc7bSXHnquV','https://s.bwzybf.com/20180811/MZbvRSpC/index.m3u8','1','11','38','51','马进欠下债务，与远房表弟小兴在底层社会摸爬滚打，习惯性的买彩票，企图一夜爆富，并迎娶自己的同事姗姗。一日，公司全体员工出海团建，途中，马进收到了彩票中头奖的信息，六千万！就在马进狂喜自己翻身的日子终于到来之际，一场突如其来的滔天巨浪打破了一切。苏醒过来的众人发现身处荒岛，丧失了一切与外界的联系……',55,NULL,'2018-08-16 00:00:00',NULL,NULL,'0'),('a7b4cf09811941d3995149adbe12303b','巴霍巴利王2','http://img.71xun.com/Fv97JbLSNbt5TDWh8YCHqJABPuFE','http://youku.cdn-163.com/20180506/6850_01f085d1/index.m3u8','1','17','31','52','据导演介绍，主创用了三个月时间才把影片的基本概念确定下来，接下来两年半的时间将故事可视化，拍出来。影片三个月前已经基本完成制作，但概念设计师还在针对部分内容进行特效工作。随着南印度导演S.S. Rajamouli一步步迈上更高的台阶，不少人开始关注他什么时候拍一部北印度语的电影。对此，导演表示还是踏实做好眼前的，接下来的重点是《巴霍巴利王》的第二部，目前，主创们已经完成了大约30%的工作，希望《巴霍巴利王》第二部分能在2016年上映。',28,'2018-05-16 00:00:00','2018-05-16 00:00:00',NULL,NULL,'0'),('b878cd3a47094a5baed7294f363f2f64','爱情公寓','http://img.71xun.com/FnMJ-reSFdoRylkMnOJtAU2-g-o3','https://s.bwzybf.com/20180814/vv1GoBRC/index.m3u8','1','11','32','51','《爱情公寓》电影版归来，原班人马十年催泪重聚。曾小贤、胡一菲、吕子乔、张伟、唐悠悠、陈美嘉悉数回归，还是熟悉的场景和熟悉的人，嘻嘻哈哈、打打闹闹，笑声从没停过。老朋友的故事将继续展开，印证了电视剧的那句主题语——“最好的朋友在身边，最爱的人就在对面”。不过这一次，他们打算搞个大事情……\r\n',53,NULL,'2018-08-15 00:00:00',NULL,NULL,'0'),('b8e7671cc74b4324b8cdbe6d6f4d970e','罪途3之正义规则','http://img.71xun.com/Fl76N9gM2JHqr8KtdYXeiZp38tqm','http://youku.cdn-iqiyi.com/20180517/10986_88ac263b/index.m3u8','1','11','38','51','本片是《罪途》三部曲的最后一部，紧接《罪途1之死亡列车》与《罪途2之救赎代价》，三集共同讲述了一个故事。经过曲折的调查，为了找出车上的凶手，何赫不得不请刘惜之进行尸检，经过一番排查，他们发现了死者真正的死因。随着列车重启上路，他们是否能够找到答案？这个答案又将如何引出凶手？十年前的真相，能否全部揭开？',17,'2018-05-18 00:00:00','2018-05-18 00:00:00',NULL,NULL,'0'),('d06db717fef0455fbb9ad0f0755e173d','的士速递5','http://img.71xun.com/FhQdEVr8qCBmUCYzETrknx0I4WYV','https://sohu.com-v-sohu.com/20180804/11909_fa36394a/index.m3u8','1','11','32','51','巴黎警官西尔万(弗兰克·盖思堂彼得 饰)因执行任务的方式过于激进,被调任马赛 社区警局。赴任第一天,便遇到意大利超跑帮抢劫珠宝,劫匪驾驶着法拉利风驰电 掣,让西尔万和“各怀绝技”的警员们“望尘莫及”、出尽洋相。正当西尔万一筹 莫展之际,他结识了憨厚莽撞的出租车司机埃迪(马利克·班泽拉 饰)。两人毫无默 契,却要合力抓捕疑犯,一场状况频出、笑料横行的猫鼠游戏即刻展开......',51,NULL,'2018-09-02 00:00:00',NULL,NULL,'0'),('d2e0534ef49c40f38a43cd837a65dfa0','巨齿鲨','http://img.71xun.com/FogFMXnjx9rjFoAPXXJ_TvCUV8Oj','https://s.bwzybf.com/20180814/qDQewUIB/index.m3u8','1','12','34','51','一项由中国主导的国际科研项目，正在马里亚纳海沟深处进行时，遭遇未知生物攻击，科研人员被困海底。前美国海军陆战队深海潜水专家乔纳斯·泰勒受命前往营救，再度遭遇数年前曾经在深海给自己留下终身难以磨灭记忆的史前生物巨齿鲨。乔纳斯联手科研项目中的中国女科学家张苏茵成功营救了被困人员，但营救行动却意外造成了巨齿鲨逃离深海。当史前巨兽重返浅海，人类将为自己对大自然的贪婪付出惨重的代价......',54,NULL,'2018-08-16 00:00:00',NULL,NULL,'0'),('ddaad16b044845b28f15d99772079e66','幕后玩家','http://img.71xun.com/FuIrZ4aArjjkr36mXcDVYKBv8IcM','https://api.suduzx.com/mdparse/?id=http://vd3.bdstatic.com/mda-idurx4faq94q406n/mda-idurx4faq94q406n.mp4','1','11','38','51','坐拥数亿财产的钟小年(徐峥 饰)意外遭人绑架，不得不在一位神秘人的操控下完 成一道道令人两难的选择题。在选择的过程中，钟小年落入陷阱，不仅巨额财产被盗取、 濒临身败名裂的边缘，还将妻子魏思蒙(王丽坤 饰)牵扯进一个个险境。为了洗脱罪名， 救回爱人，钟小年在重重危机中与神秘人展开了一场关乎生死和救赎的金钱游戏…',27,NULL,'2018-05-16 00:00:00',NULL,NULL,'0'),('e32e887ccad241049a6846ae591aefa6','超时空同居','http://img.71xun.com/FmDtzXCvta0Q2gg-UhATJ0E0kjut','http://youku.cdn2-youku.com/20180522/11566_62ac98d7/index.m3u8','1','11','32','51','来自2018年谷小焦（佟丽娅 饰）与1999年陆鸣（雷佳音 饰），两人时空重叠意外住在同一个房间。从互相嫌弃到试图“共谋大业”，阴差阳错发生了一系列好笑的事情。乐在其中的两人并不知道操控这一切的神秘人竟是想要去2037年“投机取巧”的2018年的……',5,'2018-05-28 00:00:00','2018-05-28 00:00:00',NULL,NULL,'0'),('e5ed9fa3779b469f8a22a98760253456','复仇者联盟3：无限战争','http://img.71xun.com/FpcXsXzBgvDGjxv4nny6mKa-iIYl','https://api.suduzx.com/mdparse/?id=http://vd3.bdstatic.com/mda-ie0hkcuixyqpnuwz/mda-ie0hkcuixyqpnuwz.mp4','1','12','34','51','《复仇者联盟3：无限战争》是漫威电影宇宙10周年的历史性集结，将为影迷们带来史诗版的终极对决。面对灭霸突然发起的闪电袭击，复仇者联盟及其所有超级英雄盟友必须全力以赴，才能阻止他对全宇宙造成毁灭性的打击。',32,NULL,'2018-05-16 00:00:00',NULL,NULL,'0'),('fb6276f3b401451dba312ca717946141','我不是药神','http://img.71xun.com/FhDX_I6sXnWl27nNfXn_oKGgDdBd','https://s.bwzybf.com/20180710/HJDbwFE5/index.m3u8','1','11','38','51','一位不速之客的意外到访，打破了神油店老板程勇的平凡人生，他从一个交不起房租的男性保健品商贩，一跃成为印度仿制药“格列宁”的独家代理商。收获巨额利润的他，生活剧烈变化，被病患们冠以“药神”的称号。但是，一场关于救赎的拉锯战也在波涛暗涌中慢慢展开......',44,NULL,'2018-08-17 00:00:00',NULL,NULL,'0'),('fc23a8f418014ebab6de6236a72c4711','游侠索罗：星球大战外传','http://img.71xun.com/FmGiKVrueeFh_XfK1HB-4cWC4nUU','https://youku.cdn2-youku.com/20180526/11729_2f1e0a3f/index.m3u8','1','11','31','51','在《游侠索罗》（暂译）中，影迷们将跟随“千年隼号”及银河系中最受爱戴的“恶棍”韩·索罗，迎来全新的银河系探险旅程。经过在黑暗危险的罪犯地下社会中的重重冒险，韩·索罗遇见了他未来强大的副驾驶丘巴卡、以及臭名昭著的赌徒兰多·卡瑞辛，共同展开了一场星战传奇中最不“正统”的英雄历程。',34,NULL,'2018-06-13 00:00:00',NULL,NULL,'0');

/*Table structure for table `j_video_parent` */

DROP TABLE IF EXISTS `j_video_parent`;

CREATE TABLE `j_video_parent` (
  `video_parent_id` varchar(64) NOT NULL COMMENT '视频上级id',
  `video_parent_name` varchar(64) NOT NULL COMMENT '视频父级名称',
  `photo` varchar(500) DEFAULT NULL COMMENT '视频父级显示的图片',
  `type_id` varchar(64) DEFAULT NULL COMMENT '分类id:电视剧,电影等',
  `area_id` varchar(64) DEFAULT NULL COMMENT '地区id:美国,国产等',
  `style_id` varchar(64) DEFAULT NULL COMMENT '风格id:科技,搞笑',
  `time_id` varchar(64) DEFAULT NULL COMMENT '时间年代id:2018,2017等',
  `upload_time` varchar(10) DEFAULT NULL COMMENT '更新上传时间:1\\2\\3\\4\\5\\6\\7',
  `introduce` varchar(255) DEFAULT NULL COMMENT '剧情介绍',
  `sort` int(4) DEFAULT NULL COMMENT '排序',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `create_user` varchar(64) DEFAULT NULL COMMENT '创建用户',
  `update_user` varchar(64) DEFAULT NULL COMMENT '更新用户',
  `enable` char(1) DEFAULT '0' COMMENT '是否停用：0未停用，1已停用',
  PRIMARY KEY (`video_parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `j_video_parent` */

insert  into `j_video_parent`(`video_parent_id`,`video_parent_name`,`photo`,`type_id`,`area_id`,`style_id`,`time_id`,`upload_time`,`introduce`,`sort`,`create_date`,`update_date`,`create_user`,`update_user`,`enable`) values ('0d3e478e9fa44715a41bf144a1741637','海上嫁女记','http://img.71xun.com/Ftr_cA-CwwdULU6x9R52JCJBTKbP','2','11','32','51','0','她是70后辣妈，她是90后魔女，他是80后暖男，他是帅毙了的世界玩家，四个人在错误的地点，正确的时间，遭遇了人生轨迹的交叉点，谱出一台辣妈棒打鸳鸯、女儿悔婚独立、暖男护花有情、玩家收心立业、母女携手出嫁的人间喜剧。知名演艺经纪人、单亲母亲、45岁的何念晴最大心愿是为独 生爱女何冰冰找到一位如意郎君，但就在婚礼举办前夕，女儿突然告诉她另有所爱。',8,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('1316c414378c4590bb415fab24018b3e','魔都风云','http://img.71xun.com/FjEZo_YEPEdox4xIhPiuqalZigdk','2','11','32','51','0','该剧讲述一位魔术师为理想为爱情为尊严为民族而付出的传奇一生。',3,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('2ec8a4403668452bb7d0731c9786358f','温暖的弦','http://img.71xun.com/FvA0_3VroVcFbAtQy4Dp8Shq1fZx','2','11','32','51','0','十年前，温暖意外发现姐姐温柔暗恋自己的男友占南弦，却不料导致温占两人的父亲双双罹难，遭受巨变的温暖人间蒸发，从此杳无音讯。一切准备就绪的占南弦先是逼温暖现身，再设计让温暖进入自己的公司就职。三年后的今天，占南弦又将温暖变成自己的。',9,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('2f56507cb1ed439a8ba4f684b7444e06','萌妻食神','http://img.71xun.com/FkdCl-1VW56Yq0EGDmXXV4_sr2pm','2','11','32','51','0','男主夏淳于原是靖安侯世子，受裕王所托，潜入黑风寨成为卧底，目的是要帮裕王找出黑风寨与太子秘密勾结的证据。但与黑风寨大当家白崇业相处中，兄弟情日益建立，面临情义与家国的两难抉择；现代都市女性叶佳瑶意外通过神奇陨石穿越回怀宋成为知府叶秉怀的女儿叶瑾萱，但却被掳掠上黑风寨，被白崇业当作试探夏淳于的工具，送入夏淳于的洞房。',11,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('5616d070801a4dff86def5ab3f68b709','雷霆战警','http://img.71xun.com/FnTzL-bS5Og2MWEGVZMbMr6jv9B6','2','11','32','51','0','刑警刘鸿涛是个破案高手，同事们把他的名字颠倒过来，昵称“神探红桃六”，不料由此让刘鸿涛陷入麻烦。最近几个犯罪现场都发现了一张红桃六的扑克牌，为查明真相，刘鸿涛顺藤摸瓜，查到犯罪团伙联络人马燕。不料马燕却突然死亡，线索中断，刘鸿涛从此坠入层层迷案之中。经过努力，刘鸿涛查到杀害马燕的凶手，不料此人竟是自己过世战友妹妹的男朋友——李晓军。',12,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('7e2181a9e8174f7e8eecd442d28468b0','宇宙战舰提拉米斯','http://img.71xun.com/FowbJuYYZA5kjbNFRfXHqZqug39j','2','13','2','51','0','啊是打算打算案发时发生阿萨斯是否',2,NULL,'2018-04-30 00:00:00',NULL,NULL,'0'),('83adc97f7aef4e428a6765468afd3f01','幸福巧克力','http://img.71xun.com/FiI3EevF7eLjzlnb07MzEM1tW6lA','2','11','32','51','0','独立自强的钟款款经营巧克力店替父还债，她与富贵公子段天乐意外邂逅，并结下关于巧克力的幸福约定，在钟款款帮助段天乐追求千金阮郁莹的过程中，二人的情感发生微妙变化却遭到家庭反对，同时钟款款得到了事业型男神黎允征的爱慕，剧中人不但经历着情爱的纠葛、友谊的考验，同时，钟款款又面对着自己的身世之谜...',13,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('8e6e9fc95c714211b3d50b83ed3d1d56','莽荒纪','http://img.71xun.com/FmqJm9sauAcCu5SRGNfckzi4TWwP','2','11','32','51','0','在2015年上海电视节上，电视剧版《莽荒纪》首次曝光概念海报。该剧讲述了男主角纪宁在地府因遇到六道轮回被袭击，未喝孟婆汤就投胎，而后所发生的故事。其在的影响力远超《盗墓笔记》等知名IP，也是观众最期待改编影视作品的网络小说。',6,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('9d4840d593f646b8bc1859050a79f839','阳光下的法庭','http://img.71xun.com/FkKjKwGBmC1Cwe5N4IC7DpVFFdb_','2','11','32','51','0','2017年8月，大型法治题材电视连续剧《阳光法庭》在青岛海事法院举行开机仪式。该剧由最高人民法院影视中心、青岛东唐影视科技有限公司联合出品。',15,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('a77ea15cb03d4c069ba1d3bcc904ac5c','国民安保官之绝命护卫','http://img.71xun.com/FowbJuYYZA5kjbNFRfXHqZqug39j','2','12','32','51','0','《国民安保官之绝命护卫》于2018年4月27日在爱奇艺上线，本剧由金马奖导演叶鸿伟、内地导演钢子联合执导，金钟奖编剧家陈美珊、新锐编剧孙韬共同主笔，并有香港金牌动作导演陈木川加盟，新生代优质偶像骏声、颜值男神黄志玮、台湾电视剧女神房思瑜、金马影后恬妞领衔主演。富有盛名的高级安保官李梁被指派执行一项前往列门的任务，负责押运货物，并保护国内首屈一指的环保地质学家林家诚，林教授接受国际湛蓝环境基金会的邀请，前往列门进行地质的勘测研究。就在一行人抵达列门不久后，安保公司副总陈耀辉却收到一行人皆死于工作站的消息。\r',1,NULL,'2018-04-30 00:00:00',NULL,NULL,'0'),('afdbc6cbec7346a997b3b3d1e2c410e7','她很漂亮','http://img.71xun.com/FkYXIItBoMbykian_cN5_Fr2PTyy','2','11','32','51','0','晓娜和晓维是对相差十岁的姐弟，面对生活，事业有成的晓娜和游戏宅男的晓维，却是各有各的烦恼。为了能把姐姐嫁出去，晓维使劲浑身解数，却不料他这一番折腾，还真就把姐姐的真命天子给折腾出来了。于是围绕着每个人都开始了一段奇妙的爱情之旅。',14,'2018-05-01 00:00:00','2018-05-01 00:00:00',NULL,NULL,'0'),('b461671d53ad4909846b322dca9d55b0','真爱的谎言之破冰者','http://img.71xun.com/FmndovQbh7oeEfe-lRC19J0txIMJ','2','11','32','51','0','一个装有冰毒的快递包裹，打破了都市白领谭逗逗的平静生活。寄件人是七年前逃婚的男友靳远，七年后他再出现，却让她变成了毒品犯罪嫌疑人。逗逗愤怒委屈，在去抓往警局的路上逃脱，直奔包裹来处海滨寻找靳远。靳远是警方黄伟忠乔梁等人监控中的贩毒嫌疑人，涉嫌用拍卖交易为蔡炳坤贩毒集团洗钱。',10,NULL,'2018-05-01 00:00:00',NULL,NULL,'0'),('eb542c5cc0c54af0845a687a9f9eb698','下一站别走','http://img.71xun.com/Fh6NFGR_Q1n537cdVtflp75ck3nk','2','11','32','51','0','大龄未婚的男科女博士盛夏，因遗传病发，急于结婚，生个孩子。有过两次失败婚姻的公司高管秋阳，遭遇事业危机。为了拯救公司，秋阳被亲人朋友联手逼婚。两个渴望用婚姻获得救赎的人，阴差阳错地成为了邻居，引发了一连串误会。两人怦然心动却懵懂不知，以契约形式开始了一段有名无实的婚姻，旨在为对方扫除因不婚或离异带来的困扰。',5,NULL,'2018-05-01 00:00:00',NULL,NULL,'0');

/*Table structure for table `j_video_style` */

